    enabled: true
    excluded: []
    included: []
    iterations: 1
strings:
  tostring:
    enabled: true
    excluded: []
    included: []
    iterations: 1
misc:
  vars:
    enabled: true
    excluded: []
    included: []
    iterations: 1
